import MODAL_TYPE_ENUM from "common/enumerators/ModalTypeEnum"
import { ID_EVENT, EVENT_DFE_TYPE } from "common/model/Event"

export default function DfeLink({ data, toggleModalOn, toggleFetchData}) {
    
    const getDfeLabel = (dfe_type) => {
        
        switch (dfe_type) {
            case 'MD':
              return "MDFE"
            case 'NF':
                return "NFE"
            case 'CT':
                return "CTE"
            case 'DF':
                return "DFE"
            case 'NA':
                return "SEM DFE"
            default:
                console.log(`Sorry, we are out of ${dfe_type}.`)
                return ""
          }
    }
    
    const handleClick = () => {
      let modalData = { event_id: data[ID_EVENT] }
      toggleModalOn(MODAL_TYPE_ENUM.DFE, modalData)
      toggleFetchData()
    }

    return (
    <div
        className={"underlined_text"}
        onClick={handleClick}
        style={{ textAlign: 'center', cursor: "pointer", color: '#2322c8' }}
    >
        {getDfeLabel(data[EVENT_DFE_TYPE])}
    </div>
    )
    

  }
